import React from 'react'

const Edit = () => {
    return (
        <div className='popup'>
        <div className='popup_inner'>
          <input className= "edit_input" type="text"/>
        <button className= "edit_save">Save</button>
        </div>
      </div>
    )
}

export default Edit;
